          >
            300
          </Center>
          <Center
            size={16}
            bg="primary.400"
            _text={{
              color: "white",
            }}
          >
            400
          </Center>
        </Flex>
      </Box>
        <Box>
          <Center
            size={500}
            bg="primary.100"
            _text={{
              color: "gray.800",
            }}
          >
            100
          </Center>
      </Box>
    </Center>
    </SafeAreaView>
  );
};

export default FirstPage;
